import React from 'react';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import Card from '@material-ui/core/Card';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import Grid from '@material-ui/core/Grid';
import { spacing } from '@material-ui/system';

export default class HomePage extends React.Component {
    state = {
        page: 0
    }

    switcher = (e, newVal) => {
        this.setState({ page: newVal })
        console.log(e.target, newVal)
    }
    

    render() {
        return (

            <div className="HomePage">
                <Card className="card" my="20px auto">
                    <div className="content">
                        <h2>Build Your Droplet</h2>

                        <Tabs className="tabs" onChange={this.switcher} value={this.state.page}>
                            <Tab label="Standard" />
                            <Tab label="General Purpose" />
                            <Tab label="Cpu optimized" />
                            <Tab label="memory optimized" />
                        </Tabs>

                        {this.state.page === 0 && <div className="tabItem">
                            <h2>Configuration</h2>
                            <Grid container spacing={0}>
                                <Grid item xs={6}>
                                    <List className="configDetails">
                                        CPUs:<span className="config-info">2</span>
                                    </List>
                                </Grid>
                                <Grid item xs={6}>
                                    <List className="configDetails">
                                        Memory:<span className="config-info">1 GB</span>
                                    </List>
                                </Grid>
                                <Grid item xs={6}>
                                    <List className="configDetails">
                                        Storage:<span className="config-info">25 GB</span>
                                    </List>
                                </Grid>
                                <Grid item xs={6}>
                                    <List className="configDetails">
                                        Transfer:<span className="config-info">1 TB</span>
                                    </List>
                                </Grid>
                            </Grid>

                        </div>}

                        {this.state.page === 1 && <div>
                            tow
                        </div>}
                        {this.state.page === 2 && <div>
                            three
                        </div>}
                        {this.state.page === 3 && <div>
                            four
                            </div>}
                    </div>
                </Card>
            </div>
        )
    }
}
